import "../App.css";
import Links from "./Links";
import Videos from "./Videos";
function Main() {
	return (
		<div className="Main">
			<h1>Important Links</h1>
			<section className="Links">
				<Links lnk="https://www.google.com" content="Google"></Links>
				<Links lnk="https://www.youtube.com" content="Youtube"></Links>
			</section>
			<h1>Video Tutorials</h1>
			<section className="Vidoes-section">
				<Videos lnk="https://www.youtube.com/embed/UaK4FEb8Ahs/"></Videos>
				<Videos lnk="https://www.youtube.com/embed/UaK4FEb8Ahs/"></Videos>
				<Videos lnk="https://www.youtube.com/embed/UaK4FEb8Ahs/"></Videos>
				<Videos lnk="https://www.youtube.com/embed/UaK4FEb8Ahs/"></Videos>
			</section>
		</div>
	);
}
export default Main;
